import React from 'react'
import { FlexCol, PaddingX } from '../constants/style'

export default function Header() {
  return (
    <Slide top cascade>
    <div className={`flex bg-background relative pt-[66px] pb-[150px] pl-[102px] `}>
        <img src='../images/logoBurgerIcon.png'/>
        <img src='../images/logoBurger.png' className={`h-[60px] pt-[12px]`}/>
    </div>
    </Slide>
  )
}
